import React, {Component} from 'react';
import s from './MyPosts.module.css';
import Post from "./MyPosts/Post/Post";

class MyPosts extends Component {
    render() {
        return (

                <div className={s.notes}>
                    My posts
                    <Post/>
                </div>



        );
    }
}

export default MyPosts
